import React, { useState, useEffect } from 'react';
import { io } from 'socket.io-client';

function Competition() {
  const [finishedTimes, setFinishedTimes] = useState({});

  useEffect(() => {
    const socket = io('http://localhost:8000');

    socket.on('finishedTimeUpdat', (finishedTimeData) => {
      try {
        const parsedData = JSON.parse(finishedTimeData);
        if (parsedData && parsedData.teamId && parsedData.finishedTime) {
          setFinishedTimes((prevFinishedTimes) => ({
            ...prevFinishedTimes,
            [parsedData.teamId]: parsedData.finishedTime,
          }));
        } else {
          console.error('Invalid finished time data:', finishedTimeData);
        }
      } catch (error) {
        console.error('Error parsing finished time data:', error);
      }
    });

    return () => {
      if (socket.connected) {
        socket.disconnect();
        console.log('WebSocket connection is disconnected.');
      }
    };
  }, []);

  console.log('Finished Times:', finishedTimes);

  return (
    <div>
      <h1>Competition Finished Times</h1>
      <ul>
        {Object.keys(finishedTimes).map((teamId) => (
          <li key={teamId}>
            <h3>Team ID: {teamId}</h3>
            <p>Finished Time: {finishedTimes[teamId]}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Competition;
